import { useState } from "react"
import DatePicker from "react-datepicker"
import "react-datepicker/dist/react-datepicker.css"
import { useForm } from "react-hook-form"
import { yupResolver } from "@hookform/resolvers/yup"
import * as yup from "yup"

// Validation schema
const appointmentSchema = yup.object().shape({
  name: yup.string().required("Full name is required"),
  email: yup.string().email("Invalid email").required("Email is required"),
  phone: yup.string()
    .required("Phone number is required")
    .matches(/^[0-9]+$/, "Must be only digits")
    .min(10, "Must be at least 10 digits"),
  service: yup.string().required("Please select a service"),
  date: yup.date()
    .required("Please select a date")
    .min(new Date(), "Appointment date must be in the future"),
  message: yup.string()
})

export default function Appointment() {
  const [selectedDate, setSelectedDate] = useState(null)
  
  const { 
    register, 
    handleSubmit, 
    setValue,
    formState: { errors },
    reset
  } = useForm({
    resolver: yupResolver(appointmentSchema)
  })

  // Handle date changes
  const handleDateChange = (date) => {
    setSelectedDate(date)
    setValue("date", date, { shouldValidate: true })
  }

  const onSubmit = (data) => {
    console.log("Appointment booked:", data)
    alert("Appointment booked successfully!")
    reset()
    setSelectedDate(null)
  }

  return (
    <div className="max-w-4xl mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">Book an Appointment</h1>
      
      <form onSubmit={handleSubmit(onSubmit)} className="space-y-4">
        {/* Name Field */}
        <div>
          <label htmlFor="name" className="block mb-1">Full Name*</label>
          <input
            id="name"
            {...register("name")}
            className={`w-full p-2 border rounded ${errors.name ? "border-red-500" : ""}`}
          />
          {errors.name && (
            <p className="text-red-500 text-sm mt-1">{errors.name.message}</p>
          )}
        </div>
        
        {/* Email Field */}
        <div>
          <label htmlFor="email" className="block mb-1">Email*</label>
          <input
            type="email"
            id="email"
            {...register("email")}
            className={`w-full p-2 border rounded ${errors.email ? "border-red-500" : ""}`}
          />
          {errors.email && (
            <p className="text-red-500 text-sm mt-1">{errors.email.message}</p>
          )}
        </div>
        
        {/* Phone Field */}
        <div>
          <label htmlFor="phone" className="block mb-1">Phone Number*</label>
          <input
            type="tel"
            id="phone"
            {...register("phone")}
            className={`w-full p-2 border rounded ${errors.phone ? "border-red-500" : ""}`}
            placeholder="1234567890"
          />
          {errors.phone && (
            <p className="text-red-500 text-sm mt-1">{errors.phone.message}</p>
          )}
        </div>
        
        {/* Service Field */}
        <div>
          <label htmlFor="service" className="block mb-1">Service*</label>
          <select
            id="service"
            {...register("service")}
            className={`w-full p-2 border rounded ${errors.service ? "border-red-500" : ""}`}
          >
            <option value="">Select a service</option>
            <option value="consultation">Consultation</option>
            <option value="treatment">Treatment</option>
            <option value="checkup">Checkup</option>
            <option value="emergency">Emergency</option>
          </select>
          {errors.service && (
            <p className="text-red-500 text-sm mt-1">{errors.service.message}</p>
          )}
        </div>
        
        {/* Date Picker */}
        <div>
          <label htmlFor="date" className="block mb-1">Appointment Date*</label>
          <DatePicker
            id="date"
            selected={selectedDate}
            onChange={handleDateChange}
            minDate={new Date()}
            showTimeSelect
            timeFormat="HH:mm"
            timeIntervals={30}
            dateFormat="MMMM d, yyyy h:mm aa"
            className={`w-full p-2 border rounded ${errors.date ? "border-red-500" : ""}`}
            placeholderText="Select date and time"
          />
          {errors.date && (
            <p className="text-red-500 text-sm mt-1">{errors.date.message}</p>
          )}
        </div>
        
        {/* Message Field */}
        <div>
          <label htmlFor="message" className="block mb-1">Additional Notes</label>
          <textarea
            id="message"
            {...register("message")}
            className="w-full p-2 border rounded"
            rows="4"
          />
        </div>
        
        <button
          type="submit"
          className="bg-blue-600 text-white py-2 px-6 rounded hover:bg-blue-700 transition"
        >
          Book Appointment
        </button>
      </form>
    </div>
  )
}
